import './App.css';
import {BrowserRouter, Routes, Route, Link} from 'react-router-dom';
import Base from './components/Base';
import Button from './components/Button';

const App = () => {
  return (
    <div>
    <BrowserRouter>
      <>
      <Routes>
        <Route path="/" element={<Base />}>
        </Route>
      </Routes>
      </>
    </BrowserRouter>
    </div>
  )
}

export default App;
